(689, 'Ministra presidenta Norma Piña contesta a reforma judicial de AMLO', 'https://www.elsiglodetorreon.com.mx/m/i/2024/09/1832166.jpeg', 'https://www.elsiglodetorreon.com.mx/noticia/2024/ministra-presidenta-norma-pina-ofrece-plan-de-sistema-integral-de-seguridad-publica-y-justicia-en-mexico.html', 'Este domingo, la ministra presidenta Norma Piña emitió un mensaje sobre la reforma al Poder Judicial.La ministra apareció acompañada de otros ministros de la Suprema Corte ofreciendo propuestas concretas para “Un sistema integral de Seguridad Pública y Justicia en México”. El documento parte de un ejercicio amplio de escucha y diálogo con todos los actores de los sistemas de seguridad y justicia, federal y local, así como con legisladores, organizaciones de la sociedad civil, academia, estudiantes y víctimas de la violencia”. Afirmó que es el resultado de un amplio diagnóstico que integra las necesidades reales.La presidenta de la Suprema Corte de Justicia de la Nación (SCJN) se sumó en días pasados a una de las protestas de los trabajadores del Poder Judicial pa... Más información -- Ministra presidenta Norma Piña contesta a reforma judicial de AMLO»', 'ONLY AVAILABLE IN PAID PLANS', 115, 37, 147, '2024-09-08 21:21:55', '2024-09-09 06:22:45', '2024-09-09 06:22:45'),
