(696, 'Për beqarët yjet janë në favor dhe priten shumë lajme të mira – Horoskopi, e Hënë 9 Shtator 2024', 'https://albeu.com/wp-content/uploads/2023/09/horoskopi-1-300x166.jpg', 'https://albeu.com/argetim/per-beqaret-yjet-jane-ne-favor-dhe-priten-shume-lajme-te-mira-horoskopi-e-hene-9-shtator-2024/726242/', 'Dashi Dashuria: Ende pasiguri në disa histori dashurie, ndjenjat kthehen si një vorbull dhe ju ndiheni të lëkundër nga ngjarjet. Shikoni brenda vetes para se të merrni ndonjë vendim. Zemrat e vetmuara mund të jenë të zhgënjyera nga një mik/e që mendonte se ishte i/e besuar. Puna: Ka kaq shumë mundësi për të filluar bashkëpunime [...]Read More...The post Për beqarët yjet janë në favor dhe priten shumë lajme të mira – Horoskopi, e Hënë 9 Shtator 2024 appeared first on Albeu.com.', 'ONLY AVAILABLE IN PAID PLANS', 118, 37, 150, '2024-09-08 21:21:52', '2024-09-09 06:22:46', '2024-09-09 06:22:46'),
(697, 'Roglic wins ‘crazy’ record-equalling fourth Vuelta', 'https://d4f7y6nbupj5z.cloudfront.net/wp-content/uploads/2024/09/Roglic-1.jpeg', 'https://www.namibian.com.na/roglic-wins-crazy-record-equalling-fourth-vuelta/', 'Primoz Roglic won the Vuelta a Espana for a record-equalling fourth time on Sunday, the perfect pick-me-up after crashing out of the Tour de France. The Slovenian wrapped up his fifth-career Grand Tour when he finished second in the closing time-trial on the streets of Madrid won by Stefan Kung. “It’s crazy – already four, [...]The post Roglic wins ‘crazy’ record-equalling fourth Vuelta appeared first on The Namibian.', 'ONLY AVAILABLE IN PAID PLANS', 119, 37, 151, '2024-09-08 21:21:45', '2024-09-09 06:22:46', '2024-09-09 06:22:46'),
(698, 'Ten Hag verklaart gebrekkigheid: \'Voetbal is business\'', 'https://webp.vp.cdn.pxr.nl/videofeed/previews/2024-09-08t191308-ten-hag-verklaart-gebrek-aan-clubhelden-voetballerij-is-ook-business.png?width=1200', 'https://www.voetbalprimeur.nl/videos/1224619/ten-hag-duidt-gebrek-aan-clubhelden.html', 'Erik ten Hag denkt te weten waarom er steeds minder clubmensen als Mark van der Maarel in het voetbal te vinden. De manager van Manchester United verklaart het gebrek na het afscheidsduel van de voormalig FC Utrecht-verdediger aan VoetbalPrimeur.', 'ONLY AVAILABLE IN PAID PLANS', 120, 3, 152, '2024-09-08 21:21:44', '2024-09-09 06:22:46', '2024-09-09 06:22:46'),
