(773, 'ROSEN, TRUSTED INVESTOR COUNSEL, Encourages Stellantis N.V. Investors to Secure Counsel Before Important Deadline in Securities Class Action – STLA', NULL, 'https://www.benzinga.com/pressreleases/24/09/g40764847/rosen-trusted-investor-counsel-encourages-stellantis-n-v-investors-to-secure-counsel-before-import', 'NEW YORK, Sept. 08, 2024 (GLOBE NEWSWIRE) -- WHY: Rosen Law Firm, a global investor rights law firm, reminds purchasers of securities of Stellantis N.V. (NYSE:STLA) between February 15, 2024 and July 24, 2024, both dates inclusive (the \"Class Period\"), of the important October 15, 2024 lead plaintiff deadline.SO WHAT: If you purchased Stellantis securities during the Class Period you may be entitled to compensation without payment of any out of pocket fees or costs through a contingency fee arrangement.WHAT TO DO NEXT: To join the Stellantis class action, go to https://rosenlegal.com/submit-form/?case_id=27632 or call Phillip Kim, Esq. toll-free at 866-767-3653 or email case@rosenlegal.com for information on the class action. A class action lawsuit has already been filed. If you wish to serve as lead plaintiff, you must move the Court no later than October 15, 2024. A lead plaintiff is a representative party acting on behalf of other class members in directing the litigation.WHY ROSEN LAW: We encourage investors to select qualified counsel with a track record of success in leadership roles. Often, firms issuing notices ...Full story available on Benzinga.com', 'ONLY AVAILABLE IN PAID PLANS', 10, 37, 174, '2024-09-08 21:23:00', '2024-09-09 06:24:26', '2024-09-09 06:24:26'),
